CREATE DEFINER=`root`@`localhost` PROCEDURE `ResumenTrabajo` (IN `p_idTrabajo` INT(11))  BEGIN
    SELECT 
        t.IDTrabajo AS ID,
        t.NombreTrabajo AS JobName,
        t.NombreLugar AS SiteName,
        t.Fecha AS StartDate,
        
        (SELECT COUNT(*) 
         FROM usuarios_trabajos AS ut
         INNER JOIN usuarios AS u ON ut.IDUsuario = u.IDUsuario
         WHERE ut.IDTrabajo = t.IDTrabajo AND u.TipoUsuario = 'WORKER') AS Workers,
         
        (SELECT COUNT(*) 
         FROM usuarios_trabajos AS ut
         INNER JOIN usuarios u ON ut.IDUsuario = u.IDUsuario
         WHERE ut.IDTrabajo = t.IDTrabajo AND u.TipoUsuario = 'SUPERVISOR') AS Supervisors,

        (SELECT COUNT(*)
         FROM solicitudes AS s
         INNER JOIN usuarios AS u ON s.IDUsuario = u.IDUsuario
         WHERE s.IDTrabajo = t.IDTrabajo AND u.TipoUsuario = 'WORKER') AS WorkerRequests,
        
        (SELECT COUNT(*)
         FROM solicitudes AS s
         INNER JOIN usuarios AS u ON s.IDUsuario = u.IDUsuario
         WHERE s.IDTrabajo = t.IDTrabajo AND u.TipoUsuario = 'SUPERVISOR') AS SupervisorsRequests
    FROM trabajos AS t
    WHERE t.IDTrabajo = p_IDTrabajo;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ResumenUsuario` (IN `p_IDUsuario` INT(11))  BEGIN
    SELECT 
        u.IDUsuario AS ID,
        u.Nombre AS Name,
        u.TipoUsuario AS Type,
        (SELECT COUNT(*) 
         FROM contactos_emergencia AS ce 
         WHERE ce.IDUsuario = u.IDUsuario) AS EmergencyContacts,
        (SELECT COUNT(*) 
         FROM solicitudes AS s 
         WHERE s.IDUsuario = u.IDUsuario AND s.Estado = 'REJECTED') AS RejectedRequests,
        (SELECT COUNT(*) 
         FROM solicitudes AS s 
         WHERE s.IDUsuario = u.IDUsuario AND s.Estado = 'PENDING') AS PendingRequests,
        (SELECT COUNT(*) 
         FROM solicitudes AS s 
         WHERE s.IDUsuario = u.IDUsuario AND s.Estado = 'ACCEPTED') AS AcceptedRequests,
        (SELECT COUNT(*) 
         FROM usuarios_trabajos AS ut 
         WHERE ut.IDUsuario = u.IDUsuario) AS Jobs
    FROM usuarios AS u
    WHERE u.IDUsuario = p_IDUsuario;
END$$

